			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /usr/bin/ruby;
			shellScript = "# This script sets the Parse/Testflight keys in the info plist from a .api_keys file you keep in\n# your home directory. This lets me not submit the keys to githib ;)\n\n# Fail if not run from Xcode\nraise \"Must be run from Xcode\" unless ENV['XCODE_VERSION_ACTUAL']\n\ninfo_plist = \"#{ENV['BUILT_PRODUCTS_DIR']}/#{ENV['INFOPLIST_PATH']}\"\n\n# When building for the device, the plist is already converted to binary, so change it back.\n`plutil -convert xml1 #{info_plist}`\n\n# Hack to load our keys\nkeys = IO.readlines(\"/Users/#{ENV['USER']}/.api_keys\").join\nkeys.each do |line|\n    key, value = line.split(\"=\")\n    puts \"Loading #{key} = #{value}\"\n    ENV[key] = value.strip!\nend\n\n# Open Info.plist and set the appropriate  value to the revision hash\nlines = IO.readlines(info_plist).join\nlines.gsub! /(<key>ParseProdAppID<\\/key>\\n\\t<string>).*?(<\\/string>)/, \"\\\\1#{ENV['PARSE_CIGNAL_PROD_APP_ID']}\\\\2\"\nlines.gsub! /(<key>ParseProdClientKey<\\/key>\\n\\t<string>).*?(<\\/string>)/, \"\\\\1#{ENV['PARSE_CIGNAL_PROD_CLIENT_KEY']}\\\\2\"\nlines.gsub! /(<key>ParseDevAppID<\\/key>\\n\\t<string>).*?(<\\/string>)/, \"\\\\1#{ENV['PARSE_CIGNAL_DEV_APP_ID']}\\\\2\"\nlines.gsub! /(<key>ParseDevClientKey<\\/key>\\n\\t<string>).*?(<\\/string>)/, \"\\\\1#{ENV['PARSE_CIGNAL_DEV_CLIENT_KEY']}\\\\2\"\nlines.gsub! /(<key>TestFlightKey<\\/key>\\n\\t<string>).*?(<\\/string>)/, \"\\\\1#{ENV['TESTFLIGHT_CIGNAL']}\\\\2\"\n\n# Overwrite the original Info.plist file with our updated version\nFile.open(info_plist, 'w') {|f| f.puts lines}\n\nif ENV['EFFECTIVE_PLATFORM_NAME'] == \"-iphonesimulator\" then\n    `plutil -convert xml1 #{info_plist}`\nelse\n    `plutil -convert binary1 #{info_plist}`\nend\n\n\n# Report to the user\nputs \"Updated the API Keys\"";
		};
